Featuring: Allie Haze &amp; London Keyes!
Sweetheart is bursting with excitement to bring you a lesbian film dedicated to the gorgeous and passionate Allie Haze. Allie takes us on four scenes with four of her favorite girls, each time exploring different aspects of feminine sexuality and lesbian passion. Staying true to Sweetheart's commitment to true sex and uninhibited orgasms, director Dana Vespoli brings out the best in Allie's screen performances!
